import {
  patchConsentStepThreeSuccess,
  patchStatusConsentSuccess,
  userFarmSelector,
} from '../userFarmSlice';
import { createAction } from '@reduxjs/toolkit';
import { axios, fetchAllSaga, getHeader } from '../saga';
import history from '../../history';
